import React from "react";
import './ProjectBox.module.css';
import stock_img1 from "../Assets/wallpapersden.com_macos-12-monterey-stock-dark_3840x2160.jpg";

export default function ProjectBox(){
    return <a class="main-Container" href="#">

    <div class="sub-container">

        <div>
            <img src={stock_img1} alt=""/>
            <p class="title">{props.title}</p>
        </div>
        
        <div class="project-details">
            <p class="project-name">{props.name}</p>
            <div class="rating-container">
                <i class="fa-regular fa-star fa-xs">&nbsp;&nbsp;</i>
                <p class="project-rating">{props.rating}</p>
            </div>
        </div>

    </div>

</a>;;
}
